import React, { useState, useContext } from 'react';
import { Container, Form, Button, Card, Alert } from 'react-bootstrap';
import { useNavigate, Link } from 'react-router-dom';
import { authAPI } from '../services/api';
import { AuthContext } from '../context/AuthContext';
import Swal from 'sweetalert2';

function Login() {
  const navigate = useNavigate();
  const { loginUser } = useContext(AuthContext);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const response = await authAPI.login({ email, password });
      loginUser(response.data.user, response.data.token);
      Swal.fire('Success', 'Login successful', 'success').then(() => {
        navigate('/dashboard');
      });
    } catch (err) {
      const message = err.response?.data?.message || 'Login failed';
      setError(message);
      Swal.fire('Error', message, 'error');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-page">
      <div className="auth-card">
        <div className="auth-side">
          <h3>CaliberWatch</h3>
          <p>Timeless pieces. Exceptional craftsmanship. Sign in to manage orders and wishlist.</p>
        </div>

        <div className="auth-main">
          <div className="auth-form">
            <div className="auth-brand">
              <div className="auth-logo">CW</div>
              <div>
                <h4 className="auth-title">Welcome Back</h4>
                <div className="auth-sub">Sign in to continue to CaliberWatch</div>
              </div>
            </div>

            <Card>
              <Card.Body>
                {error && <Alert variant="danger">{error}</Alert>}

                <Form onSubmit={handleSubmit}>
                  <Form.Group className="mb-3">
                    <Form.Label>Email</Form.Label>
                    <Form.Control
                      type="email"
                      placeholder="Enter email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                    />
                  </Form.Group>

                  <Form.Group className="mb-3">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                      type="password"
                      placeholder="Enter password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                    />
                  </Form.Group>

                  <Button className="w-100 btn-rose" type="submit" disabled={loading}>
                    {loading ? 'Logging in...' : 'Login'}
                  </Button>
                </Form>

                <hr />
                <div className="text-center">
                  <p>Don't have an account?</p>
                  <Link to="/register" className="btn btn-outline-light w-100">
                    Create account
                  </Link>
                </div>
              </Card.Body>
            </Card>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
